import React, { useState, useEffect } from 'react';
import { Page } from './Page';
import { apiRequest } from '../utils/apiRequest';

export const Form = () => {
  const [forms, setForms] = useState([]);

  const fetchData = async () => {
    await apiRequest
      .get('/form.php')
      .then((res) => {
        setForms(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  const f = [
    {
      id: 1,
      name: 'Whats your name?',
      type: 'text',
      formid: 1,
      options: [],
    },
  ];
  return (
    <Page>
      <table className='table table-striped'>
        <thead>
          <tr>
            <th scope='col'>ID</th>
            <th scope='col'>Name</th>
            <th scope='col' colspan='2'>
              Actions
            </th>
          </tr>
        </thead>
        <tbody>
          {forms.map((key, index) => (
            <tr key={index}>
              <th scope='row'>{key.id}</th>
              <td>
                <a href={`/form/${key.id}`}>{key.name}</a>
              </td>
              <td className='d-flex'>
                <button className='btn btn-success btn-sm px-4'>Update</button>
                <button className='btn btn-danger'>Delete</button>
                <button className='btn btn-warning'>Delete</button>
              </td>
              <td />
            </tr>
          ))}
        </tbody>
      </table>
    </Page>
  );
};
